import logo from './assets/retrocomp.gif';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">  
      Andrew Kallmeyer
      <div className="header">
        <img src ={logo} alt="logo" />
      </div>
      </header>
    </div>
  );
}

export default App;
